	@Test
	public void sequenceDist() {
		String s = "AAAAAAAAAAAA";
		short[] dist = TiledAlignerUtil.getBaseDistribution(s);
		assertEquals(false, TiledAlignerUtil.isDistEvenlySpread(dist, s.length(), 10d));
		s = "AAAAAAAAAAAACCCCCCCCCC";
		dist = TiledAlignerUtil.getBaseDistribution(s);
		assertEquals(false, TiledAlignerUtil.isDistEvenlySpread(dist, s.length(), 10d));
		s = "AAAAAAAAAAAACCCCCCCCCCGGGGGGGGGG";
		dist = TiledAlignerUtil.getBaseDistribution(s);
		assertEquals(false, TiledAlignerUtil.isDistEvenlySpread(dist, s.length(), 10d));
		s = "AAAAAAAAAAAACCCCCCCCCCGGGGGGGGGGTTTTTTTTTT";
		dist = TiledAlignerUtil.getBaseDistribution(s);
		assertEquals(true, TiledAlignerUtil.isDistEvenlySpread(dist, s.length(), 10d));
		s = "AAAAAAAAAAAACCCCCCCCCCGGGGGGGGGGTTTT";
		dist = TiledAlignerUtil.getBaseDistribution(s);
		assertEquals(true, TiledAlignerUtil.isDistEvenlySpread(dist, s.length(), 10d));
		s = "AAAAAAAAAAAACCCCCCCCCCGGGGGGGGGGTTT";
		dist = TiledAlignerUtil.getBaseDistribution(s);
		assertEquals(false, TiledAlignerUtil.isDistEvenlySpread(dist, s.length(), 10d));
		s = "CACCCCCCCNCCCCCCCCCCCCCCCCCCCCCCCNCNGTTTCCCCCTNTTTTCCCCGGCCGGGGGNGATGGGGGGGGATCGGGCCTTTGCA";
		dist = TiledAlignerUtil.getBaseDistribution(s);
		assertEquals(false, TiledAlignerUtil.isDistEvenlySpread(dist, s.length(), 10d));
		s = "CACCCCCCCNCCCCCCCCCCCCCCCCCCCCCCCNCNGTTTCCCCCTNTTTTCCCCGGCCGGGGGNGATGGGGGGGGATCGGGCCTTTGCA";
		dist = TiledAlignerUtil.getBaseDistribution(s);
		assertEquals(false, TiledAlignerUtil.isDistEvenlySpread(dist, s.length(), 5d));
		s = "GCAAGACTGTGTCTCAAAAAAAAACAAACAAAAAAAAACAACCAAGGGGTGGATTTGGTCCAGGTCTTCAACCCTAGTTGCACATTAGAATCAATCACCTGAGAGATGTTTAAAAATACCCATGCCTGATCCTCCTCACAGACCAATTAAATCAGAACCTCCAGCAGG";
		dist = TiledAlignerUtil.getBaseDistribution(s);
		assertEquals(true, TiledAlignerUtil.isDistEvenlySpread(dist, s.length(), 10d));
		s = "TTCCATTACATTGCATTCCATTCCATTCCAATCGGGTTGATTTCATTCCATTCCATTCCATTCTAATCCATTCCATTCCGTCCCATTCCCTTCCATTCCATTCCATTCCTTTCCCTTCCCTTCCCTTCCATTCTATTCCTTTCTTTTGCTT";
		dist = TiledAlignerUtil.getBaseDistribution(s);
		assertEquals(false, TiledAlignerUtil.isDistEvenlySpread(dist, s.length(), 10d));
		s = "TTCCATTACATTGCATTCCATTCCATTCCAATCGGGTTGATTTCATTCCATTCCATTCCATTCTAATCCATTCCATTCCGTCCCATTCCCTTCCATTCCATTCCATTCCTTTCCCTTCCCTTCCCTTCCATTCTATTCCTTTCTTTTGCTT";
		dist = TiledAlignerUtil.getBaseDistribution(s);
		assertEquals(false, TiledAlignerUtil.isDistEvenlySpread(dist, s.length(), 5d));
	}
	
	@Test
	public void getTileCounts() {
		setup();
		Map<Integer,TLongList> map = TiledAlignerUtil.getCountStartPositionsMapUsingCache(cache,"",13,false,true);
		for (Entry<Integer, TLongList> entry : map.entrySet()) {
			System.out.println("entry: " + entry.getKey() + ", " + entry.getValue().size());
		}
		assertEquals(8,map.size());
//		assertEquals(1, map.get(17956864).size());
		assertEquals(1, map.get(8781824).size());
		assertEquals(1, map.get(9306112).size());
		assertEquals(25, map.get(393216).size());
		assertEquals(12, map.get(458752).size());
		assertEquals(4, map.get(524288).size());
		assertEquals(1, map.get(589824).size());
		assertEquals(1, map.get(655360).size());
		assertEquals(1, map.get(720896).size());
	}
	
